export type IconName = 
  | 'add-image'
  | 'align-center'
  | 'align-distributed'
  | 'align-justify'
  | 'align-left'
  | 'align-right'
  | 'bg-color'
  | 'bold'
  | 'border-all'
  | 'border-bottom'
  | 'border-inside'
  | 'border-left'
  | 'border-none'
  | 'border-outside'
  | 'border-right'
  | 'border-top'
  | 'cancel'
  | 'code-block'
  | 'code'
  | 'column-add-after'
  | 'column-add-before'
  | 'column-delete'
  | 'delete'
  | 'enter'
  | 'fill-color'
  | 'font-color'
  | 'font-decrease'
  | 'font-increase'
  | 'heading'
  | 'highlight'
  | 'image'
  | 'italic'
  | 'link'
  | 'list-ordered'
  | 'list-unordered'
  | 'lock'
  | 'merge-cells'
  | 'open-link'
  | 'paragraph'
  | 'quote'
  | 'redo'
  | 'row-add-after'
  | 'row-add-before'
  | 'row-delete'
  | 'split-cell'
  | 'strikethrough'
  | 'table-delete'
  | 'table'
  | 'task-list'
  | 'underline'
  | 'undo'
  | 'unlock'

export function getIcon(name: IconName): string | undefined {
  return ICONS[name]
}

export function getAllIconNames(): IconName[] {
  return Object.keys(ICONS) as IconName[]
}
